// React
import React, { Component } from "react";

// React Router
import { BrowserRouter as Router, Link } from "react-router-dom";

// Pages

// Bootstrap Components
import { Button, Col, Container, Row } from "react-bootstrap";

class Nav extends Component {
  render() {
    return (
      <nav>
        <div className="mobileNav">
          <Container>
            <img src={"/assets/logo-uhc-link-white.svg"} className="logo" />
            <i class="lni lni-menu"></i>
          </Container>
        </div>
        <div className="desktopNav">
          <Row>
            <div className="top">
              <img src={"/assets/logo-uhc-link.svg"} className="logo" />
              <div className="navUtilities">
                <div className="navButtons">
                  <Router>
                    <Button className="navButton"><Link>Label <i class="fas fa-xs fa-external-link-alt"></i></Link></Button>
                    <Button className="navButton"><Link>Return to Link Dashboard<i class="fas fa-xs fa-external-link-alt"></i></Link></Button>
                    <Button className="navButton"><Link>Help<i class="fas fa-question-circle"></i></Link></Button>
                    <Button className="navButton"><Link>Track It<i class="fas fa-circle notification"></i></Link></Button>
                    <Button className="navButton"><Link>My Account<i class="fas fa-user-circle"></i></Link></Button>
                    <i class="fas fa-angle-down"></i>
                  </Router>
                </div>
                <div className="navButtons">
                  <button className="navButton">87726 - UnitedHealthcare<i class="fas fa-angle-down"></i></button>
                  <button className="navButton">Scott Brundle<i class="fas fa-angle-down"></i></button>
                </div>
              </div>
            </div>
          </Row>
          <div className="bottom"></div>
        </div>
      </nav>
    );
  }
}

export default Nav;
